import styled from 'styled-components';

export const Container = styled.div`
    display: flex;

    .lado-esquerdo {
        width: 50%;
        height: 400px;
        background-color: green;
    }
    .lado-direito {
        width: 50%;
        height: 400px;
        background-color: blue;
    
        .imagem {
            height: 400px;
        }
    }
`;
